import React from"react";

const Todocard=(props)=>{


	const{todo}=props;
	const{id,title,completed}=todo;

return(
	<React.Fragment>
		<h5>Id: {id}</h5>
		  <h5>Title:  {title}</h5>                                                    <h5>{`Completion: ${completed}`}</h5>


	</React.Fragment>
	);


}

export default Todocard;
